import React, {Component,Fragment} from 'react'
import Link from "next/link";

class Index extends Component {
  render() {

    return (
      <Fragment>
        <h1>Navigation bar</h1>
        <p>
          Go to{" "}
          <Link href="/about">
            <a>about</a>
          </Link>
        </p>
        <p>
          Go to{" "}
          <Link href="/online_baccarat">
            <a>online Baccarat</a>
          </Link>
        </p>
      </Fragment>

    )
  }
}

export default Index
